import React from 'react';
import Head from 'next/head';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import { red } from '@material-ui/core/colors';
import Link from 'next/link';
import axios from 'axios';
import withAnalytics from '../src/hocs/withAnalytics';

const useStyles = makeStyles(theme => ({
  card: {
    maxWidth: 500,
    marginTop: 10
  },
  avatar: {
    backgroundColor: red[500]
  },
  media: {
    height: 420,
    paddingTop: '56.25%' // 16:9
  }
}));

function Home({ user }) {
  //const classes = useStyles();

  return (
    <>
      <Head>
        <title>Home</title>
      </Head>
      <CssBaseline />
      <Container maxWidth="sm">
        <Card style={{ maxWidth: 500, marginTop: 10 }}>
          <CardHeader
            avatar={
              <Avatar aria-label="recipe" style={{ backgroundColor: red[500] }}>
                J
              </Avatar>
            }
            title={user.name}
            subheader={user.company}
          />
          <CardMedia
            style={{ height: 420, paddingTop: '56.25%' }}
            image={user.avatar_url}
            title="Avatar"
          />
          <CardContent>
            <Typography variant="body2" color="textSecondary" component="p">
              {user.bio}
            </Typography>
          </CardContent>
        </Card>
        <br />
        <Link href="/users">
          <a>Usu√°rios</a>
        </Link>
      </Container>
    </>
  );
}

Home.getInitialProps = async ({ query }) => {
  //const response = await axios.get(`https://api.github.com/users/joshuamaia`);

  return {
    user: {
      avatar_url: '/static/joshua.jpeg',
      bio: 'Teste biotonico',
      company: 'Codata'
    }
  };
};

export default withAnalytics()(Home);
